import EditableTable from '../components/table/EditableTable';
import Buttons from '../components/buttons/Buttons';
import MainDropdown from '../components/main-dropdown/MainDropdown';
import Options from '../components/options/Options';

function JobLocation(props) {
  return (
    <>
    <Options        JobLink="Job Locations"/>
      <Buttons />
      <MainDropdown onChangeS={props.onChangeS} />
      <EditableTable
        JobLink="Job Locations"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        location1="New York"
        location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        statuss="status"
        result={props.result}
        handleDelete={props.handleDelete}
      />
    </>
  );
}

export default JobLocation;
